import {apiClient} from "../../../config/axios";

export const getUsers = async (params) => {
   const stringParams = `ID=${params.id}`;
   return  apiClient.get(`?${stringParams}`);
};

export function updateUserProfile({ id, ...data }) {
   return apiClient.post(`/`, data);
}
